pragma solidity ^0.4.23;

contract QuoteChain {
    mapping(address => address) fromWho;
    mapping(address => string) private quote;
    address lastQuoteOwner;

    constructor(string _quote) public{
        //equire(bytes(_quote).length != 0);
        lastQuoteOwner = msg.sender;
        quote[lastQuoteOwner] = _quote;
    }

    function getQuote(string _quote) public{
        //require(fromWho[msg.sender] == 0);
        //require(bytes(_quote).length != 0);

        quote[msg.sender] = _quote;
        fromWho[msg.sender] = lastQuoteOwner;
        lastQuoteOwner = msg.sender;
    }

    function yourQuote()view public returns(string){
        //require(fromWho[msg.sender] != 0);

        return quote[fromWho[msg.sender]];
    }
}
